import React from 'react'
import Card from '../Components/Card'
import { useCharStates } from '../Context/Context'
import '../App.css'
const Home = () => {

  const {list} = useCharStates()

  return (
    <div className='Cardgrid'>
      {list.map(item => <Card item={item} key={item.id}/>)}
    </div>
  )
}

export default Home
